const Resume = () => {
    return (
        <div className="row">
            <div className="menber-img">
                <img className="fotopaty" src={fotopaty} alt="Foto Patrcia" />
                 </div>
        <div class="menber-info">
            <h4>Patricia Ruffino</h4>
            <span>Desenvolvedora Full Stack</span>
        </div>

            </div>




    )
}

export default Resume
